import React, { useState } from "react";
import { useCSVReader } from "react-papaparse";

const CSVFileReader = () => {
  const [jsonData, setJsonData] = useState(null);

  const handleFileLoaded = (data) => {
    // Convert CSV data to JSON
    const jsonData = data.map((row) => row.data);
    setJsonData(jsonData);

    // Store JSON data in local storage
    localStorage.setItem("csvData", JSON.stringify(jsonData));
  };

  const { openDialog } = useCSVReader({
    onFileLoaded: handleFileLoaded,
  });

  return (
    <div>
      <h2>CSV File Reader</h2>
      <button onClick={openDialog}>Upload CSV File</button>
      {jsonData && (
        <div>
          <h3>JSON Data</h3>
          <pre>{JSON.stringify(jsonData, null, 2)}</pre>
        </div>
      )}
    </div>
  );
};

export default CSVFileReader;
